import Navbar from "react-bootstrap/Navbar"
import Container from "react-bootstrap/Container"
import Nav from "react-bootstrap/Nav"
import {Link} from "react-router-dom"
import "./header.css"


const Header = () =>{
    return (
    <><Navbar bg="primary" variant="dark"><Container><Navbar.Brand to="/"><strong>Employee Managment System</strong></Navbar.Brand><Nav classname="ml-auto"><Nav.Link as={Link} to="/" className="nav-link">Employees</Nav.Link><Nav.Link as={Link} to="/employee" className="nav-link">Post Employees</Nav.Link></Nav></Container></Navbar></>
    )
}

export default Header;
